// Funciones auxiliares para trabajar con los datos

/**
 * Obtener todas las gestantes
 * @returns {Array} Array con todos los registros
 */
function obtenerTodasGestantes() {
  return SEGUIMIENTO_GESTANTES;
}

/**
 * Buscar gestante por DNI
 * @param {string|number} dni - DNI de la gestante
 * @returns {Object|null} Registro de la gestante o null si no existe
 */
function buscarPorDNI(dni) {
  return SEGUIMIENTO_GESTANTES.find(g => g.N_DNI_HIS == dni) || null;
}

/**
 * Buscar gestante por HC (Historia Cl铆nica)
 * @param {string|number} hc - N煤mero de historia cl铆nica
 * @returns {Object|null} Registro de la gestante o null si no existe
 */
function buscarPorHC(hc) {
  return SEGUIMIENTO_GESTANTES.find(g => g.HC == hc) || null;
}

/**
 * Buscar gestantes por nombre (b煤squeda parcial)
 * @param {string} nombre - Nombre o parte del nombre
 * @returns {Array} Array con gestantes que coinciden
 */
function buscarPorNombre(nombre) {
  const nombreUpper = nombre.toUpperCase();
  return SEGUIMIENTO_GESTANTES.filter(g => 
    g.Nombre_P && g.Nombre_P.toUpperCase().includes(nombreUpper)
  );
}

/**
 * Filtrar gestantes por IPRESS
 * @param {string} ipress - Nombre del IPRESS
 * @returns {Array} Array con gestantes del IPRESS especificado
 */
function filtrarPorIPRESS(ipress) {
  return SEGUIMIENTO_GESTANTES.filter(g => g.IPRESS_HIS === ipress);
}

/**
 * Obtener lista 煤nica de IPRESS
 * @returns {Array} Array con nombres de IPRESS 煤nicos
 */
function obtenerIPRESS() {
  const ipress = new Set();
  SEGUIMIENTO_GESTANTES.forEach(g => {
    if (g.IPRESS_HIS) ipress.add(g.IPRESS_HIS);
  });
  return Array.from(ipress).sort();
}

/**
 * Obtener n煤mero de consultas de una gestante
 * @param {Object} gestante - Objeto gestante
 * @returns {number} Cantidad de consultas realizadas
 */
function contarConsultas(gestante) {
  let count = 0;
  for (let i = 1; i <= 15; i++) {
    const cpn = gestante[`CPN_${i}`];
    if (cpn && cpn !== '' && cpn !== '0') count++;
  }
  return count;
}

/**
 * Obtener gestantes con menos de N consultas
 * @param {number} minConsultas - N煤mero m铆nimo de consultas
 * @returns {Array} Array con gestantes que tienen menos consultas
 */
function gestantesConPocasConsultas(minConsultas = 4) {
  return SEGUIMIENTO_GESTANTES.filter(g => contarConsultas(g) < minConsultas);
}

/**
 * Obtener 煤ltima hemoglobina registrada
 * @param {Object} gestante - Objeto gestante
 * @returns {number|null} Valor de 煤ltima HB o null
 */
function ultimaHemoglobina(gestante) {
  for (let i = 15; i >= 1; i--) {
    const hb = gestante[`HB_${i}`];
    if (hb && hb > 0) return hb;
  }
  return null;
}

/**
 * Identificar gestantes con anemia (HB < 11)
 * @returns {Array} Array con gestantes con anemia
 */
function gestantesConAnemia() {
  return SEGUIMIENTO_GESTANTES.filter(g => {
    const hb = ultimaHemoglobina(g);
    return hb !== null && hb < 11;
  });
}

/**
 * Obtener historial de consultas de una gestante
 * @param {Object} gestante - Objeto gestante
 * @returns {Array} Array con objetos de consultas
 */
function obtenerHistorialConsultas(gestante) {
  const consultas = [];
  for (let i = 1; i <= 15; i++) {
    const fecha = gestante[`CPN_${i}`];
    if (fecha && fecha !== '' && fecha !== '0') {
      consultas.push({
        numero: i,
        fecha: fecha,
        atendio: gestante[`ATENDIO_${i}`] || 'No registrado',
        peso: gestante[`PESO_${i}`] || null,
        talla: gestante[`TALLA_${i}`] || null,
        hemoglobina: gestante[`HB_${i}`] || null
      });
    }
  }
  return consultas;
}

/**
 * Filtrar gestantes por rango de edad
 * @param {number} edadMin - Edad m铆nima
 * @param {number} edadMax - Edad m谩xima
 * @returns {Array} Array con gestantes en el rango
 */
function filtrarPorEdad(edadMin, edadMax) {
  return SEGUIMIENTO_GESTANTES.filter(g => 
    g.Edad >= edadMin && g.Edad <= edadMax
  );
}

/**
 * Obtener gestantes por domicilio (b煤squeda parcial)
 * @param {string} domicilio - Domicilio o parte del domicilio
 * @returns {Array} Array con gestantes que coinciden
 */
function buscarPorDomicilio(domicilio) {
  const domicilioUpper = domicilio.toUpperCase();
  return SEGUIMIENTO_GESTANTES.filter(g => 
    g.Domicilio && g.Domicilio.toUpperCase().includes(domicilioUpper)
  );
}

/**
 * Estad铆sticas generales
 * @returns {Object} Objeto con estad铆sticas del sistema
 */
function obtenerEstadisticas() {
  const total = SEGUIMIENTO_GESTANTES.length;
  const conAnemia = gestantesConAnemia().length;
  const pocasConsultas = gestantesConPocasConsultas(4).length;
  
  // Calcular edad promedio
  const edades = SEGUIMIENTO_GESTANTES.map(g => g.Edad).filter(e => e > 0);
  const edadPromedio = edades.reduce((a, b) => a + b, 0) / edades.length;
  
  // Consultas promedio
  const totalConsultas = SEGUIMIENTO_GESTANTES.reduce((sum, g) => 
    sum + contarConsultas(g), 0
  );
  const consultasPromedio = totalConsultas / total;
  
  return {
    totalGestantes: total,
    gestantesConAnemia: conAnemia,
    porcentajeAnemia: ((conAnemia / total) * 100).toFixed(2) + '%',
    gestantesConPocasConsultas: pocasConsultas,
    porcentajePocasConsultas: ((pocasConsultas / total) * 100).toFixed(2) + '%',
    edadPromedio: edadPromedio.toFixed(1),
    consultasPromedio: consultasPromedio.toFixed(1),
    totalIPRESS: obtenerIPRESS().length
  };
}

// Exportar para uso en Node.js (si aplica)
if (typeof module !== 'undefined' && module.exports) {
  module.exports = {
    SEGUIMIENTO_GESTANTES,
    obtenerTodasGestantes,
    buscarPorDNI,
    buscarPorHC,
    buscarPorNombre,
    filtrarPorIPRESS,
    obtenerIPRESS,
    contarConsultas,
    gestantesConPocasConsultas,
    ultimaHemoglobina,
    gestantesConAnemia,
    obtenerHistorialConsultas,
    filtrarPorEdad,
    buscarPorDomicilio,
    obtenerEstadisticas
  };
}
